sys_variable_value.value:
(function execute(inputs, outputs) {

    var flowActionUtil = new FDActionUtil();
    var result = flowActionUtil.getCurrentDate();
    gs.info("aru-->"+result);

    outputs.current_full_date = result[0];
    outputs.current_year = result[1];
    outputs.current_month = result[2];
    outputs.current_day = result[3];

})(inputs, outputs);

